import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import miroutes from './config/routes';

import './App.scss';

//console.log(miroutes);

function App() {
  return (
    <Router>
      <Routes>
        {miroutes.map((route, index) => (
          <Route />
        ))}
      </Routes>
    </Router>
  );
}

function RouteWithSubRoutes(route) {
  console.log(route);
  return true;
}

export default App;
